import React from 'react';
import ReactDOM from 'react-dom/client';

import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Home from "./pages/onglets/home/Home"
import Message from "./pages/onglets/messages/Message"
import Profile from "./pages/onglets/profile/Profile"

import Login from "./pages/forms/Login"
import Logout from "./pages/forms/Logout"
import Register from "./pages/forms/Register"

import NoPage from "./pages/statics/NoPage"
import MustLoggedInPage from "./pages/statics/MustLoggedInPage"

import GoVersus from "./pages/GoVersus"

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">

          <Route index element={<GoVersus component={<Home />} title='Home - GoVersus' tab='home' />} />
          <Route path="home" element={<GoVersus component={<Home />}  title='Home - GoVersus' tab='home' />} />
          <Route path="messages" element={<GoVersus component={<Message />}  title='Messages - GoVersus' tab='messages' />} />
          <Route path="profile" element={<GoVersus component={<Profile />}  title='Profile - GoVersus' tab='profile' />} />

          <Route path="login" element={<Login />} />
          <Route path="logout" element={<Logout />} />
          <Route path="register" element={<Register />} />

          <Route path="must" element={<MustLoggedInPage />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>

  );
}




// initialisation
const content = document.getElementById('root');
const root = ReactDOM.createRoot(content);
root.render(<App />);
